contracts/Waves.sol.content:
pragma solidity >=0.8.0 <0.9.0;
//SPDX-License-Identifier: MIT

contract Waves {
  function getWaves() external pure returns (bytes memory){
    return(
      abi.encodePacked('<image opacity=".3"  xlink:href="data:image/png;base64,"/>')
    );
  }
}

